import React from 'react';
import sunMode from "../assets/img/icons/sun.svg";
import darkMode from "../assets/img/icons/moon.svg";
import {NavLink} from "react-router-dom";

function Nav(props) {
    return (
        <nav className="nav">
            <div className="container">
                <div className="nav-row">
                    <NavLink className="logo">
                        <strong>Freelancer</strong> portfolio
                    </NavLink>

                    <button className="dark-mode-btn">
                        <img src={sunMode} alt="Light mode" className="dark-mode-btn__icon"/>
                        <img src={darkMode} alt="Dark mode" className="dark-mode-btn__icon"/>
                    </button>

                    <ul className="nav-list">
                        <li className="nav-list__item"><a href="./index.html"
                                                          className="nav-list__link nav-list__link--active">Home</a>
                        </li>
                        <li className="nav-list__item"><a href="./projects.html"
                                                          className="nav-list__link">Projects</a></li>
                        <li className="nav-list__item"><a href="./contacts.html"
                                                          className="nav-list__link">Contacts</a></li>
                    </ul>
                </div>
            </div>
        </nav>
    );
}

export default Nav;
